    <div class="container">
		
        <h1>Naturalness Evaluations</h1>
        <p>Listen to the sample of speech and assess the quality of the audio based on how close it is to natural speech on a scale of 1 to 5. For better results, wear headphones and work in a quiet environment.</p>
	
        <div class="row">
            <div class="col-md-6">
                <h3>Audio</h3>
                <audio id="audio" controls>
                    <source src="" type="audio/wav">
                </audio>
            </div>
        </div>

        <div id="trialscompleted">Trials Completed 0</div>

        <!-- Create radio buttons for audio rating input from 1 to 5. 1 being very dissimalr and 5 being extremely similar -->

        <div class="row">
            <div class="col-md-12">
                <h3>How natural is the above audio?</h3>
                <form id="rating-form">
                    <div class="radio">
                        <label><input type="radio" name="rating" value="1">1 Completely Unnatural Speech</label>
                    </div>
                    <div class="radio">
                        <label><input type="radio" name="rating" value="2">2 Mostly Unnatural Speech</label>
                    </div>
                    <div class="radio">
                        <label><input type="radio" name="rating" value="3">3 Equally Natural and Unnatural Speech</label>
                    </div>
                    <div class="radio">
                        <label><input type="radio" name="rating" value="4">4 Mostly Natural Speech</label>
                    </div>
                    <div class="radio">
                        <label><input type="radio" name="rating" value="5">5 Completely Natural Speech</label>
                    </div>
                    <input type="text" id="name" placeholder="Enter your name here" required>
                    <button type="submit" class="btn btn-primary">Submit</button>
                </form>
            </div>
        </div>

// Shuffle Audios
function shuffle(array) {
  let currentIndex = array.length,  randomIndex;

  // While there remain elements to shuffle.
  while (currentIndex > 0) {

    // Pick a remaining element.
    randomIndex = Math.floor(Math.random() * currentIndex);
    currentIndex--;

    // And swap it with the current element.
    [array[currentIndex], array[randomIndex]] = [
      array[randomIndex], array[currentIndex]];
  }

  return array;
}

audios = shuffle(audios);

var current_audio_num = 0;

var server_address = "https://scevcplusplus.ngrok.app";

function load_audio(){
    $("#audio").attr("src", audios[current_audio_num]);
}

load_audio();

function submit_rating(){
    var rating_value = $("input[name='rating']:checked").val();
    // assert rating is selected
    if (rating_value == undefined){
        alert("Please select a rating");
        return;
    }

    var rater_name = $("#name").val();
    var rating = rating_value;
    // https://expressivecloning.s3.us-east-2.amazonaws.com/groundtruth/target_23_7.wav
    // Name should be groundtruth_target_23_7.wav
    var audio_name = audios[current_audio_num].split(".com/")[1];
    audio_name = audio_name.split("/")[0] + "-" + audio_name.split("/")[1];

    console.log(audio_name);
    
    var post_url = server_address + "/submit_naturalness_rating" ;
    $.ajax({
        type: "POST",
        url: post_url,
        data: {
            "rater_name": rater_name,
            "rating": rating,
            "audio_name": audio_name,
        },
        success: function(data){
            console.log("success");
            console.log(data);
        },
        error: function(data){
            console.log("error");
            console.log(data);
        }
    });


    // Clear the radio buttons
    $("input[name='rating']").prop("checked", false);

    current_audio_num++;
    $("#trialscompleted").text("Trials Completed " + current_audio_num);

}

$("#rating-form").submit(function(e){
    e.preventDefault();
    submit_rating();
    if (current_audio_num < audios.length){
        load_audio();
    } else {
        alert("Thank you for your participation!");
    }
});
